import React from "react";
import './../css/Userbox.css'


function Userbox() {
    return(
        <div className="Box-User-Nav">
            <div className="Box-In-Profile"></div>
            <div className="Box-In-TopUP"></div>
            <div className="Box-In-Upload"></div>
            <div className="Box-In-Setting"></div>
            <div className="Box-In-Log"></div>
        </div>
    )
}

export default Userbox
